import { Routes, Route } from "react-router-dom";

// Layout
import Layout from "./layout/Layout";

// pages

import NotFound from "./pages/NotFound";

const App = () => {
  return (
    <Layout>
      <Container>
        <Routes>
          <Route path="/" element={<menu />} exact />
          {/* <Route path="/orders" element={<Orders />} /> */}
          <Route element={<NotFound />} />
        </Routes>
      </Container>
    </Layout>
  );
};

export default App;
